import React from "react";
import { NavLink } from "react-router-dom";

const TheItem = (props) => {
  return (
    <div className="item">
      <div className="item__image">
        <NavLink>
          <img src={props.pic} alt="item"></img>
        </NavLink>
      </div>
      <div className="item__desc">
        {props.title}
        <h5>24</h5>
      </div>
    </div>
  );
};

export default TheItem;
